import React from 'react'
import { useMouseMove } from './useMouseMove';

const MouseMove = () => {
    const coords = useMouseMove();

    return (
        <div className="Ap">
            <center>
                <br />
                <h1>X: {coords.x}</h1>
                <h1>Y: {coords.y}</h1>
            </center>

        </div>
    )

}


export default MouseMove;
